def generate_sql(template, asset_id):
    replacements = {
        'asset_id': asset_id,
    }
    
    
    
    # Generate UUIDs for asset_attribute ids
    for i in range(1, 22):
        replacements[f'attr_id_{i}'] = str(uuid.uuid4())
    
    
    for placeholder, value in replacements.items():
        template = template.replace('{{' + placeholder + '}}', value)
    
    return template

